def add(n1, n2):
    return n1 + n2
def subtract(n1, n2):
    return n1 - n2
def multiply(n1, n2):
    return n1 * n2
def divide(n1, n2):
    return n1 / n2
def divide_rest(n1, n2):
    return n1 % n2
def number(n):
    return int(n)
def square(n):
    return n * n
def cube(n):
    return n ** 3